import React from 'react';
// import './App.css';  // Comment this line out temporarily

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Book Recommender</h1>
        <p>Your personalized book recommendation app is loading...</p>
      </header>
    </div>
  );
}

export default App;
